  Redirect,
  withRouter
} from "react-router-dom";
import ShoppingSite from "./Components/ShoppingSite";
import Products from "./Store";
import AuthPage from "./Components/AuthPage";

let store = new Products();

function App() {
  return (
    <Router>
      <div>
        <AuthPage />
